import React, { Component } from 'react'

class Expend extends Component{
    render(){
        return(
            <div className='APP'>
                这是消耗管理,可以写一些有关于生产消耗的内容,可以从作物成长过程中的农药消耗、肥料消耗(消耗时间、消耗类别、消耗数量等)等入手
            </div>
        )
    }
}
export default Expend
